              "description": {
                "__cdata": "Atuar como Agente de Registro de Certificação Digital.\n\nO Agente de Registro é o cartão de visita da empresa de certificação digital. É a linha de frente.\n\nA principal função do Agente de Registro é a de prospectar clientes de acordo com as diretrizes da Empresa no seguimento de Certificação Digital, identificando a potencialidade de negócio de cada um.\n\nFeita a captação e o fechamento do negócio o Agente de Registro recepcionará os documentos obrigatórios e autenticará sua veracidade. Além disso, ele deve inserir as informações corretamente no sistema de validação e, para tanto, é necessário que ele tenha um bom conhecimento em informática, atenção e zelo na conferência das informações.\n\nTão importante quanto a venda, a análise de documentação é a função que mais requer atenção no trabalho do Agente de Registro, pois cada tipo de empresa tem suas particularidades, tendo em vista que não existe um único modelo padrão de documentação.\n\nO Agente de Registro deverá possuir uma visão proativa, estratégica e ampla, conseguindo enxergar quais as possíveis soluções caso haja algum problema que venha atrapalhar o andamento da validação, respeitando as regras estabelecidas pela certificadora.\n\nPERFIL:\n\n- Idade mínima: 25 anos;\n- Formação Básica: Ensino Médio Completo;\n- Formação Desejada: Cursando ou Graduado em Administração ou TI;\n- Desejável Possuir CNH AB;\n- Desejável possuir carro ou moto;\n- Obrigatório possuir um notebook ;\n- Experiência mínima de 01 ano comprovada na CTPS com venda direta e ou via callcenter;\n- Conhecimento em Informática e utilização de Sistemas de Informação;\n- Disponibilidade para viagens;\n- Disponibilidade de trabalho aos sábados quando necessário;\n- Modelo de contrato de trabalho CTPS(HORA)/ Flexibilidade de horário;;\n- Ajuda de custo fixa;\n- Comissionamento de vendas progressivo por desempenho;\n- Situação regular junto aos agentes de crédito SERASA/SPC;\n- Inglês Básico;"
              },
