                "__cdata": "<strong>Atividades:</strong>\n\n- Atender clientes por telefone;\n- Verificar no sistema, a disponibilidade de peças que estão no estoque;\n- Preencher vendas perdidas no sistema;\n- Emitir as notas fiscais dos produtos vendidos;\n- Emitir romaneio de peças para compras e para clientes;\n- Fazer orçamento para clientes;\n- Responder cotações de clientes;\n- Negociar com o cliente os valores das peças;\nManter atualizado os cadastros de clientes (Frota, telefone, e-mail, pessoa\nde contato);\n- Manter a ordem e limpeza do setor através dos princípios 5S e coleta\nseletiva;\n- Propor melhorias nos procedimentos, visando aumentar a produtividade e\na qualidade do serviço executado.\n\n<strong>Requisitos:</strong>\n\n- Ensino Médio Completo.\n- Conhecimento em Linhas de passeio e caminhões de linha leve.\n- Conhecimento em peças e estoque.\n- Desejável Experiência com Atendimento ao Cliente.\n- CNH B.\n\n<span style=\"color: #0000ff\"><strong>Encaminhar o currículo até 03/02 preenchendo o campo</strong></span>\n<span style=\"color: #0000ff\"><strong>\"Assunto\" com o título vaga.</strong></span>"
