            function addVaga(vaga){
                
                
                toast.success(`Vaga ${vaga.slug} postada!`, {
                  position: "bottom-center",
                  autoClose: 3500,
                  hideProgressBar: false,
                  closeOnClick: true,
                  pauseOnHover: false,
                  draggable: false,
                  progress: undefined,
                })

                axios.post("/api/addVaga",vaga)
              
            
            }

    return (
        <div id="Container" className="flex flex-col min-h-screen bg-gray-100">
           
            <div className="mt-2 text-md">
            <p className="flex justify-between   p-2"  ><span>Ação</span> <span>ID </span> <span>Título da Vaga</span> <span>ID Empresa</span> <span>ID Cidade</span></p>
            {json.map(vaga => {
                return <p className="flex justify-between text-left  p-1 " key={vaga.id}> <span onClick={()=>addVaga({
                    title: vaga.name.__cdata,
                    slug: vaga.link.__cdata.replace("https://maisvagases.com.br/vaga/","").replace("/",""),
                    application:vaga.email.__cdata,
                    description:vaga.description.__cdata,
                    place:idOfCidade(vaga.region.__cdata),
                    company:idOfEmpresa(vaga.company.__cdata),
                    logo:`https://imgmves.vercel.app/${vaga.image.__cdata}`,
                    facebook:vaga.facebook.__cdata,
                    instagram:vaga.instagram.__cdata,
                    linkedin:vaga.linkedin.__cdata,
                    companydescription:vaga.companydescription.__cdata,
                  })} className=" bg-gray-800 rounded-md p-2 text-white cursor-pointer" >Postar Vaga </span>
                  
                  <span className="text-gray-800 ">{vaga.id}</span> 
                  <span className="text-gray-800 ">{vaga.name.__cdata}</span>
                  <span className="text-verdinho">{idOfEmpresa(vaga.company.__cdata)} </span> <span className="text-facebook">{idOfCidade(vaga.region.__cdata)}</span> 
                  
                  </p>
            })}
            </div>
        </div>

    )
